import logo from './TravelBuddyLogo.svg';
import logoText from './TravelBuddyText.svg'
import { GoogleLogin } from 'react-google-login';
import './App.css';

function App() {

  const onSuccess = (res) => {
    console.log("Login Successful: ", res.profileObj);
    setIsLoggedIn(true);
    setUserProfile(res.profileObj);

    fetch('http://localhost:5000/api/verify-token', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json',
        },
        body: JSON.stringify({idToken: res.tokenId,
            accessToken: res.accessToken,
        }),
        credentials: 'include'
    })
    .then(response => response.json())
    .then(response => {
        onLoginSuccess(res.accessToken);

    console.log("response:", response);
})

};
const onFailure = (res) => {
    console.log("Login Failure: ", res);
}
  return (
    <div className="App">
      <header className="App-header">
        <div className="logo-container">
        <img src={logo} className="App-logo" alt="logo" />
        <img src={logoText} className="App-logo-text" alt="logo" />
        </div>
        <div id="signInButton">
            <GoogleLogin 
            clientId={client_ID}
            buttonText="Login"
            onSuccess={onSuccess}
            onFailure={onFailure}
            cookiePolicy={'single_host_origin'}
            isSignedIn={true} />
            </div>
      </header>
    </div>
  );
}

export default App;
